import { Link, NavLink } from "react-router-dom";
import Data from './Data'

const CutData = (props) => {
  let curIndex = props.index;
  return (
    <ul className="App">
      <NavLink to="/src/components/Data.js">
        <li onClick={() => {props.updateData(curIndex)}}>{props.CutData}</li>
      </NavLink>
    </ul>
  );
};

export default CutData;
